                Home
            </div>
            <div onClick={()=>{setActiveTab('Groups')}}>
                Groups
            </div>
            <div onClick={()=>{setActiveTab('Settings')}}>
                Settings
            </div>
            <div onClick={()=>{setActiveTab('Invite')}}>
                Invite
            </div>
            <div onClick={()=>{setActiveTab('Logout')}} >
                Logout
            </div>
        </div>
    );
}

export default BashboardMenu;
